import React, { Component } from 'react'
import Background from "../../img/bground.jpg";

class Intro extends Component {

  render() {
    return (
      <div className="Intro" style={{ backgroundImage: "url(" + Background + ")", backgroundSize: "cover", height: "100vh" }}>
        <h1>UrbanSmart</h1>
        <p>Get the quality of life data on any urban area of your choice.</p>
      </div>
    )
  }
}

export default Intro
